import React, { Component } from 'react';

import Burger from 'react-css-burger';

class Menu extends Component {
  render() {
    return (
      <div>
        {' '}
        <Burger
          onClick={() => this.setState({ active: !this.state.active })}
          active={this.state.active}
          burger="arrow"
          color="black"
          hoverOpacity={0.8}
          scale={1}
        />
      </div>
    );
  }
}

export default Menu;
